import React, { Component } from 'react';
import './Header.css';
import { Form, Nav, Navbar, Button } from "react-bootstrap";
import { NavLink } from 'react-router-dom'

class Header extends React.Component {
  constructor(props){
    super(props);

    this.state={
      login: false
        }
    }

    render() {
        return (
            <div class="navbar"> 
                <ul class="navbar-left">
                <li class="nav-item">
                    <a href="/" class="navbar-button pl-3">Habit Rabbit</a>
                </li>
                </ul>
                <ul class="navbar-right">
                <li class="nav-item">
                    <NavLink
                        to="/home"
                        className="nav-link"
                        activeStyle={{ fontWeight: 'bold' }}
                    >
                      Home
                    </NavLink>
                </li>
                <li class="nav-item">
                    <NavLink
                        to="/about"
                        className="nav-link"
                        activeStyle={{ fontWeight: 'bold' }}
                    >
                      About
                    </NavLink>
                </li>
                <li class="nav-item">
                    <a href="/login" class="navbar-button">Log In</a>
                </li>
                <li class="nav-item">
                    <a href="/signup" class="navbar-button">Sign Up</a>
                </li>
                </ul>
            </div>  
    );
  }
}

export default Header;
